import styled from "styled-components";

export const HugeHead = styled.h1`
  font-size: 12em;
`;

export const LargeHead = styled.h2`
  font-size: 10em;
`;

export const MediumHead = styled.h3`
  font-size: 8em;
`;

export const SmallHead = styled.h4`
  font-size: 2.25em;
  font-weight: 700;
`;

export const TinyHead = styled.h5`
  font-size: 1.8em;
  font-weight: 700;
`;
